import './App.css';
import { useState } from 'react';
import { Landing } from './Landing-page/Landing-page.js';
import { UploadDownload } from './Upload-Download-page/Upload-Download-page.js';

function App() {

  const upload = Landing.upload;
  const codesubmit = Landing.codesubmit;


  return (
    <div>
      {
        (upload || codesubmit) ? (
          <UploadDownload/>
        ) : (
          <Landing/>
          )
      }
    </div>
  );
}

export default App;
